import './App.css';
import Reiniciar from './Components/Reiniciar';
import NumeroSecreto from '.Components'

function App() {
  return (
    <div className="container">
    <Reiniciar/>
    <h1>¡Adivina mi número!</h1>
    <NumeroSecreto/>
    <br/>

    <div className="guess-section">

        <input type="number" id="guess" placeholder="Número" min="1" max="20"/>
        <button onclick="checkGuess()">Check!</button>
    </div>

    <div className="score-section">
      <br/>
      <p>Empiece a adivinar...</p>  
      <br/>
      <p>Puntuación: <span id="score">20</span></p>
      <p>Puntaje Alto: <span id="highscore">0</span></p>
    </div>
  </div>
  );
}

export default App;
